import React from 'react';
import VideoDisplay from "../VideoDisplay/VideoDisplay"
import VideoListStyle from "../VideoList/VideoList.scss"


class VideoList extends React.Component {

        
  render(){

    console.log("props = ", this.props)
  return (
    
      <>
        <h2>NEXT VIDEO</h2>
        <ul>
          {this.props.videoDetail.map((video) => {
            return (
              <div>
              <img src={video.image}/>
              <li
                key={video.id}
                onClick={() => this.props.setCurrentVideo(video.id)}
              >
                {video.title}
                {video.channel}
               
              </li>
              </div>
               
            );
          })}
        </ul>
      </>
  )}
}

export default VideoList
